import {firstOf2021} from "../ui/2021.js";

let lastPB, lastAvg5, lastAvg12 = false;
let currentSession, newestSession;
let isBLD, bldSilence;

let cooldown = false;

let isSolving, startedSolving, solvingInterval, lastScreen, currentScreen = false;

function wrChecker(time) {
    let type = tools.getCurScramble()[0];
    switch (type) {
        case '222so':
            if (time < 0.49) $(document).trigger('voice', ['NEW_WR222']);
            break;
        case '333':
            if (time < 3.47) $(document).trigger('voice', ['NEW_WR333']);
            break;
    }
}

function parseTime(time) {
    let splitDecimal = time.split('.');
    if (splitDecimal.length == 2) {
        let decimal = splitDecimal[1];
        let splitTime = splitDecimal[0].split(':');
        let times = splitTime.length;
        let seconds = parseInt(splitTime[times-1]);
        let minutes = 0;
        let hours = 0;
        if (times > 1) minutes = parseInt(splitTime[times-2]);
        if (times > 2) hours = parseInt(splitTime[times-3]);
        minutes = minutes + (hours * 60);
        seconds = seconds + (minutes * 60);
        return parseFloat(seconds + '.' + decimal);
    }
    return false;
}

function startSolve() {
    if (isSolving) return;
    startedSolving = new Date().getTime();
    isSolving = true;
    if (kernel.getProp('scrType') == 'r3ni' && Boolean(kernel.getProp('mbldAutoStop'))) {
        let timeout = 60 * (60000);
        switch (kernel.getProp('timeU')) {
            case 'u':
                timeout -= 29;
                break;
            case 'c':
                timeout -= 200;
                break;
            case 's':
                timeout -= 2000;
                break;
        }
        let alarm = new Audio(kernel.getProp('mbldAlarm'));
        solvingInterval = setInterval(function() {
            if ((new Date().getTime()) - startedSolving >= timeout) {
                alarm.play();
                let evv = jQuery.Event("keydown");
                $('#lcd').trigger(evv);
            }
        }, 100);
    }
    $(document).keydown(function(e) {
        if (isSolving) {
            console.log('Stopped', solvingInterval);
            if (solvingInterval) clearInterval(solvingInterval);
            isSolving = false;
            lastScreen = false;
        }
    });
}

function solveChecker() {
    if (cooldown) return false;
    cooldown = true;
    setTimeout(() => {
        cooldown = false;
    }, 200);
    bldSilence = Boolean(kernel.getProp('bldSilence'));
    isBLD = /^(333ni|444bld|555bld|r3ni)$/.exec(kernel.getProp('scrType')) != null;
    let session = kernel.getProp('session');
    let currentSolve = /([\d]+)\//.exec($('th.times[data=0]').text());
    if (currentSolve != null) {
        currentSolve = parseInt(currentSolve[1]);
        let hasPb = Boolean($('td[data=bs]').length);
        let hasAvg5 = Boolean($('td[data=ba1]').length);
        let hasAvg12 = Boolean($('td[data=ba2]').length);
        let currentPB = parseTime($('td[data=bs]').text());
        let currentAvg5 = parseTime($('td[data=ba1]').text());
        let currentAvg12 = parseTime($('td[data=ba2]').text());
        let currentSingle = $('.stattl table').find('tr[data]').eq(0).find('td').eq(1).text();
        if ((!lastPB && hasPb) || (currentSession != session && hasPb)) lastPB = currentPB;
        if ((!lastAvg5 && hasAvg5) || (currentSession != session && hasAvg5)) lastAvg5 = currentAvg5;
        if ((!lastAvg12 && hasAvg12) || (currentSession != session && hasAvg12)) lastAvg12 = currentAvg12;
        // 2021
        //firstOf2021(currentSingle);
        if (currentSession == session && currentSingle == 'DNF' && (!bldSilence && isBLD || !isBLD)) $(document).trigger('voice', ['DNF']);
        if (currentSession == session && currentSingle.substr(-1) == '+' && (!bldSilence && isBLD || !isBLD)) $(document).trigger('voice', ['+2']);
        currentSingle = parseTime(currentSingle);
        if (currentSession == session) {
            if (currentSingle == 8.88) {
                $(document).trigger('voice', ['SECONDS_888']);
            } else if (currentSingle == 5.55 && tools.getCurScramble()[0] == '333') {
                $(document).trigger('voice', ['SECONDS_555']);
            } else if (currentSingle == 4.74 && tools.getCurScramble()[0] == '333') {
                $(document).trigger('voice', ['SECONDS_474']);
            }
            if (currentSingle > 0) {
                $(document).trigger('wca_record_checker', [tools.getCurScramble()[0], currentSingle]);
            }
            if (currentSolve >= 5) {
                if (currentPB < lastPB && (!bldSilence && isBLD || !isBLD)) {
                    lastPB = currentPB;
                    $(document).trigger('voice', ['NEW_PB']);
                } else if (currentSolve >= 10 && (currentAvg5 < lastAvg5 && (!bldSilence && isBLD || !isBLD))) {
                    lastAvg5 = currentAvg5;
                    $(document).trigger('voice', ['NEW_PBAVG5'])
                } else if (currentSolve >= 24 && (currentAvg12 < lastAvg12 && (!bldSilence && isBLD || !isBLD))) {
                    lastAvg12 = currentAvg12;
                    $(document).trigger('voice', ['NEW_PBAVG12'])
                }
            }
            switch (currentSolve) {
                case 12:
                case 50:
                case 88:
                case 100:
                case 500:
                case 888:
                case 1000:
                    $(document).trigger('voice', ['SOLVES_'+currentSolve]);
                    break;
                case 5000:
                    $(document).trigger('voice', ['SOLVES_5K']);
                    break;
                case 10000:
                    $(document).trigger('voice', ['SOLVES_10K']);
                    break;
                case 100000:
                    $(document).trigger('voice', ['SOLVES_100K']);
                    break;
            }
        }
        currentSession = session;
        if (session > newestSession) {
            newestSession = session;
            $(document).trigger('voice', ['NEW_SESSION']);
        }
    }
}

function mbldAlarm(plusLang = {}) {
    kernel.regProp('timer', 'mbldAutoStop', 0, plusLang.PLUS_MBLD_AUTO_STOP, [false]);
    let alarms = [
        "data:audio/mpeg;base64,",
        "data:audio/mpeg;base64,",
        "data:audio/mpeg;base64,",
        "data:audio/mpeg;base64,",
        "data:audio/mpeg;base64,",
        "data:audio/mpeg;base64,"
    ];
    let lastidx = 0;
    let interacted = false;
    function procSignal(signal, value) {
        if (value[0] == "mbldAlarmSound") {
            lastidx = value[1];
            let alarm = alarms[lastidx];
            if (typeof alarm != 'undefined') {
                kernel.setProp('mbldAlarmSound', lastidx);
                kernel.setProp('mbldAlarm', alarm);
                if (value[2] == 'modify' && interacted) {
                    let trial = new Audio(kernel.getProp('mbldAlarm'));
                    trial.play();
                }
            }
        }
    }

    $(function () {
        kernel.regListener('mbldAlarm', 'property', procSignal, /^mbldAlarmSound$/);
        kernel.regProp('timer', 'mbldAlarmSound', 1, plusLang.PLUS_MBLD_ALARM_SOUND, ['0', ['0', '1', '2', '3', '4', '5'], plusLang.PLUS_MBLD_ALARM_SOUND_OPT.split('|')]);
    });
    $(document).on('click', function() {
        if (!interacted) interacted = true;
    });
}

export function events(plusLang = {}) {
    kernel.regProp('timer', 'shorterIns', 0, plusLang.PLUS_SHORTER_INSPECTIONS, [false]);
    kernel.regProp('timer', 'bldSilence', 0, plusLang.PLUS_BLD_SILENCE_MODE, [true]);
    mbldAlarm(plusLang);
    currentSession = kernel.getProp('session');
    newestSession = kernel.getProp('sessionN');
    let hasPb = Boolean($('td[data=bs]').length);
    let hasAvg5 = Boolean($('td[data=ba1]').length);
    let hasAvg12 = Boolean($('td[data=ba2]').length);
    if (!lastPB && hasPb) lastPB = parseTime($('td[data=bs]').text());
    if (!lastAvg5 && hasAvg5) lastAvg5 = parseTime($('td[data=ba1]').text());
    if (!lastAvg12 && hasAvg12) lastAvg12 = parseTime($('td[data=ba2]').text());
    const inspection = document.getElementById('multiphase');
    const config = { attributes: true, childList: true, subtree: true };
    let inspectionHint = function(mutationsList, observer) {
        for(let mutation of mutationsList) {
            if (mutation.type === 'childList') {
                let	 hint = $(inspection).find('div > div').html();
                if (typeof(hint) === 'string') {
                    if (hint[0] == '8') {
                        $(document).trigger('voice', ['INSPECTION_8']);
                    } else if (hint[0] == 'G') {
                        $(document).trigger('voice', ['INSPECTION_12']);
                    }
                }
            }
        }
    };
    const iObs = new MutationObserver(inspectionHint);
    iObs.observe(inspection, config);
    const lcdScreen = document.getElementById('lcd');
    let lastScreen = false;
    let lcdCheck = function(mutationsList, observer) {
        for(let mutation of mutationsList) {
            if (mutation.type === 'childList') {
                let	screen = $(lcdScreen).text();
                if (screen == 'DNF') {
                    $(document).trigger('voice', ['INSPECTION_17']);
                }
                if (kernel.getProp('input') == 't') {
                    if (!isSolving) {
                        if (screen == TIMER_SOLVE) {
                            startSolve();
                        } else {
                            if (!lastScreen) {
                                lastScreen = parseFloat(screen);
                                currentScreen = lastScreen;
                            } else {
                                currentScreen = parseFloat(screen);
                            }
                            if (currentScreen > lastScreen) {
                                startSolve();
                            }
                            lastScreen = currentScreen;
                        }
                    }
                }
            }
        }
    };
    const lcdObs = new MutationObserver(lcdCheck);
    lcdObs.observe(lcdScreen, config);
    const solves = $('.stattl').get(0);
    let solveNumbers = function(mutationsList, observer) {
        for(let mutation of mutationsList) {
            if (mutation.type === 'childList') {
                solveChecker();
            }
        }
    };
    const svObs = new MutationObserver(solveNumbers);
    svObs.observe(solves, config);
    $('#scrambleDiv select').on('change', function() {
        setTimeout(function() {
            let currentSolve = /([\d]+)\//.exec($('th.times[data=0]').text());
            if (currentSolve != null) {
                currentSolve = parseInt(currentSolve[1]);
                if (currentSolve == 0 && tools.puzzleType(tools.getCurScramble()[0]) == 'sq1') $(document).trigger('voice', ['NEW_SESSION_SQ1']);
                if (tools.getCurScramble()[0] == '333fm') $(document).trigger('voice', ['FMC_SESSION']);
                if (tools.getCurScramble()[0] == '333ft') $(document).trigger('voice', ['FEET_SESSION']);
                if (tools.puzzleType(tools.getCurScramble()[0]) == '555') $(document).trigger('voice', ['555_SESSION']);
                if (tools.puzzleType(tools.getCurScramble()[0]) == 'clk') $(document).trigger('voice', ['CLK_SESSION']);
                if (tools.puzzleType(tools.getCurScramble()[0]) == 'pyr') $(document).trigger('voice', ['PYR_SESSION']);
                if (tools.puzzleType(tools.getCurScramble()[0]) == 'skb') $(document).trigger('voice', ['SKB_SESSION']);
            }
        }, 200);
    });
}